import React from "react";
import { Link } from "react-router-dom";

const Profile = (props) => {
    const {isLoggedIn} = props;
    return (
        <div>
            {
                isLoggedIn ? (<h3>Welcome to your profile</h3>) : (<p>Please log in to view your posts</p>)

            }
        </div>

    )
}

export default Profile;
